import React from 'react';
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { makeStyles } from '@material-ui/core/styles';
import TranslateIcon from '@material-ui/icons/Translate';
import IconButton from '@material-ui/core/Button';
import SearchIcon from '@material-ui/icons/Search';
import SearchRoundedIcon from '@material-ui/icons/SearchRounded';

const useStyles = makeStyles((theme) => ({
    root: {
      '& > *': {
        margin: theme.spacing(1),
      },
    },
  }));

function Navbar() {

    const classes = useStyles();

    return (
        <div>
            <nav className="navbar navbar-expand-md navbar-dark bg-dark">
                <div className="container">
                    <a href="#" className="navbar-brand mr-1">Music App</a>


                    <button className="navbar-toggler" data-toggle="collapse" data-target="#navid">
                        <span className="navbar-toggler-icon"></span>
                    </button>

                    <div className="collapse navbar-collapse ml-lg-5" id="navid">
                        <ul className="navbar-nav mr-auto">
                            <li className="nav-item">
                                <a href="#" className="nav-link">Home</a>
                            </li>
                            <li className="nav-item">
                                <a href="#" className="nav-link">My Music</a>
                            </li>
                            <li className="nav-item">
                                <a href="#" className="nav-link">Help</a>
                            </li>

                        </ul>

                        <ul className="navbar-nav ml-auto">
                            <li className="nav-item">
                                <form className="d-inline-flex">
                                    <input className="form-control me-2 ml-lg-2 ml-sm-0 ml-md-0 mt-2 mt-lg-0" style={{borderRadius:"16px"}} type="search" placeholder="Search" aria-label="Search"/>
                                    {/* <IconButton className="btn btn-outline-success ml-2 mt-2 mt-lg-0" type="submit"> */}
                                    <div className={classes.root}>  
                                    <IconButton color="primary">
                                        <SearchRoundedIcon/>
                                    </IconButton>
                                    </div> 
                                </form>
                            </li>
                            <li className="nav-item">
                                <IconButton className="btn btn-outline-success nav-item mt-2 mt-lg-0" type="submit">
                                    <TranslateIcon color="primary"/>
                                </IconButton>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
        </div>
    );
}
export default Navbar;
